import NavBar from './component/navbar';
import './App.css';
import React, { Component }  from 'react';
import Counters from './component/counters'; 

class App extends Component{

  render () {
    return (
      <React.Fragment>
        <NavBar />
        <main className='container'>
          <Counters />
        </main>
      </React.Fragment>
    );
  }
}

export default App;
